measurements.description:
Two flowers on two inflorescences;
	dorsal sepal deep red-purple, golden yellow veined red-purple basally;
    lateral sepals deep red;	
    petals cream, single purple-red stripe central third of midrib;

	lip intense dark red;
	column cream edged purple-red along anther cap, striped purple-red along ventral margins;


	substance firm; texture velvety.
